import "./App.css";
import { useState } from "react";
import City from "./components/City";
import Weather from "./components/Weather";
import axios from "axios";
import WeatherNext from "./components/WeatherNext";

function App() {
  const [city, setCity] = useState();
  const [weather, setWeather] = useState();
  const fetch = async (e) => {
    e.preventDefault();
    const response = await axios.get(
      `http://api.openweathermap.org/data/2.5/weather?q=${city}&appid=fe4feefa8543e06d4f3c66d92c61b69c`
    );
    setWeather(response.data);
  };
  return (
    <div className="container">
      <h1>HIIIddd</h1>

      <City className="city" setCity={setCity} fetch={fetch}></City>
      {weather && <Weather className="weather" weather={weather}></Weather> && (
        <WeatherNext
          lat={weather.coord.lon}
          lon={weather.coord.lat}
        ></WeatherNext>
      )}
    </div>
  );
}

export default App;
